import React, { useEffect } from "react";
import GetWishs from "../API/GetWishs.ts";

function SelfPaje(props)
{
    const [wishs, setWishs] = React.useState([{id:0, present:"", price:"", reservUser:0, userId:0, userName:""}])
    useEffect(()=>{
        const get = async () =>{
          const data = await GetWishs(props.id);
          setWishs(data);
        }
        get();
      }, []);

      if(wishs[0].id==0)
        return(<></>);   

      const listItemsNotReserv = wishs.map((wish) =>
        wish.reservUser==null ?
        <ul key={wish.id}>
          <li>
            {wish.present}
          </li>
          <li>
            {wish.price}
          </li>
        </ul> 
        : null 
      );

      const listItemsReserv = wishs.map((wish) =>
        wish.reservUser ?
        <ul key={wish.id}>
          <li>
            {wish.present}
          </li>
          <li>
            {wish.price}
          </li>
          <li>
            {wish.reservUser}
          </li>
        </ul> 
        : null 
      );
      console.log(listItemsReserv)
      const SetItemsNotReserv = new Set(listItemsNotReserv);
      const SetItemsReserv = new Set(listItemsReserv);

      return (
          <div>
            {
                listItemsNotReserv.length==1 && listItemsNotReserv[0]==null ?
                <>
                    <h1>Не забронированные желания</h1>
                    <div className="ListWishs">
                        {listItemsNotReserv}
                    </ div>
                </>:
                <h1>Все желания заняты</h1>
            }
            {
                listItemsNotReserv.length==1 && listItemsNotReserv[0]==null ?
                <>
                    <h1>Забронированные желания</h1>
                    {listItemsReserv}
                </>:
                <h1>Пока что никто не забронировал</h1>
            }
          </div>
        );
}
export default SelfPaje
